def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)
    for i in range(len(bins)):
        if item <= bins[i]/3:
            if item % 3 == 0:
                priorities[i] = np.power(item + 2, 1.2) / bins[i]
            elif item % 3 == 1:
                priorities[i] = np.log1p(item + 4) / bins[i] + np.sqrt(item + 4) / bins[i]
            else:
                priorities[i] = 3*(item + 6) / bins[i]
        elif item > bins[i]/3 and item <= bins[i]/2:
            if bins[i] % 4 == 0:
                priorities[i] = np.cbrt(item / bins[i]) + np.power(item / bins[i], 1.5)
            else:
                priorities[i] = np.log1p(item / bins[i]) + np.sqrt(item / bins[i])
        elif item > bins[i]/2 and item <= bins[i]*0.75:
            if item % 2 == 0:
                priorities[i] = 2*(item + 3) / bins[i] + np.log1p(item + 3) / bins[i]
            else:
                priorities[i] = np.sqrt(item + 5) / bins[i] + np.exp(item + 5) / bins[i]
        else:
            if item % 4 == 0:
                priorities[i] = np.cbrt(item / bins[i]) + np.power(item / bins[i], 1.8)
            elif item % 4 == 1:
                priorities[i] = np.log1p(item / bins[i]) + np.sqrt(item / bins[i])
            elif item % 4 == 2:
                priorities[i] = np.log(item / bins[i]) + np.square(item / bins[i])
            else:
                priorities[i] = np.sqrt(item / bins[i]) + np.log1p(item / bins[i])

    return priorities
